import React from 'react';
// import './css/style.css';


function MakeSponsor(props) {
	return (
		<a
        	href={props.url}
			// target="_blank"
        >
		<img
			className="img-fluid TRoweLogo"
			src={props.logo}
		/>
		</a>
	);
}

class Sponsor extends React.Component {
	renderSponsor(u,c,l) {
		return(
			<MakeSponsor
				url={u}
				className={c}
				logo={this.props.l}
			/>
		);
	}
	render() {
		return(
	<div className="wrapper">
        <h1 className="section-header-gray">
          <span className="bracket-color"></span> Sponsors
          <span className="bracket-color"></span>
        </h1>
        <br />
        <div className="row sponsors">
          <div className="col-sm-4 TRowePos" style="text-align: center">
            {this.renderSponsor("https://www3.troweprice.com/usis/corporate/en/home.html","TRowe","../img/sponsors/TRowe.png")}
          </div>
        </div>
     </div>
     );
 }
}

export default Sponsor;
// export default SponsorPage;
